INSERT INTO wydawnictwo (nazwa, data_zalozenia) VALUES ('Papirus', '2014-4-21');
INSERT INTO wydawnictwo (nazwa, data_zalozenia) VALUES ('Pióro i miecz', '1995-5-17');
INSERT INTO wydawnictwo (nazwa, data_zalozenia) VALUES ('Zielony Atrament', '2012-1-12');
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Ostatni promień nadzieji', 'W krainie, gdzie sny stają się rzeczywistością, bohater musi odkryć, czyja wyobraźnia może uratować świat.', 2, 3);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Z Tobą być, jeść, spać', 'Tajemnicza księga kieruje losami trzech nieznajomych, wprowadzając ich w światy, których nie zdawali sobie sprawy, że istnieją.', 13, 3);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Jutro', 'W świecie, gdzie emocje są barwami, zakazane uczucie staje się jedyną nadzieją na wolność.', 11, 3);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Pojutrze', 'Podczas podróży przez kosmiczne zakamarki, załoga statku kosmicznego odkrywa zapomnianą planetę, której istnienie może zmienić losy galaktyki.', 10, 4);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Zapomniałem', 'Niewinny spacer po parku staje się kluczem do innej rzeczywistości, gdzie każdy krok może zdezorganizować struktury czasoprzestrzeni.', 2, 1);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Naleśnik w kieszeni żółtego szlafroka', 'W magicznym lesie, gdzie drzewa mają dusze, grupa dzieci musi uratować swoją wioskę przed zapomnianą klątwą.', 5, 1);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Pozaświatowcy', 'Życie młodego artysty zmienia się, gdy odkrywa, że jego obrazy zaczynają ożywać, przynosząc ze sobą magiczne moce.', 11, 1);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Biała Perła', 'W mieście, gdzie wszyscy noszą maski, bohater próbuje odkryć tajemnicę, dlaczego ludzie ukrywają swoje prawdziwe twarze.', 8, 1);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Filipiada', 'Starożytna legenda o zapomnianym mieście staje się rzeczywistością, gdy grupa poszukiwaczy skarbów wyrusza na niebezpieczną wyprawę.', 7, 4);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Soliniki i gdzie je znaleźć', 'Kobieta budzi się bez wspomnień, a jedyny trop to tajemniczy klucz, który otwiera drzwi do jej własnej przeszłości.', 8, 5);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Za dużo leków na złamane serce', 'W świecie, gdzie każde zwierzę posiada magiczną moc, grupa poszukiwaczy przygód musi odkryć, dlaczego magia zaczyna zanikać.', 2, 2);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('W chmurach', 'Losy trzech obcych splatają się, gdy odkrywają, że każde z nich posiada unikalny dar, który może zmienić bieg historii.', 5, 4);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Upadek z tysiąca metrów', 'W krainie cieni i snów, bohater musi stawić czoła własnym lękom, aby ocalić swoje najskrytsze marzenia.', 10, 5);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Brudne naczynia w zlewie', 'W czasach, gdy księżyce opowiadają legendy, grupa podróżników musi odnaleźć zaginiony artefakt, by ocalić swoje królestwo.', 10, 1);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Krwawy Półksiężyc', 'Na odległej planecie, gdzie czas płynie inaczej, astronauci muszą znaleźć sposób powrotu na Ziemię przed utratą kontaktu z rzeczywistością.', 6, 1);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Jak pokonałem własną matkę', 'Niezwykła siła połączenia umysłów przekształca życie grupy ludzi, tworząc wspólny świat pełen magicznych możliwości.', 2, 2);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Zagubieni w czasie', 'Złodziej o nieprzewidywalnych zdolnościach odkrywa, że skradziony artefakt jest kluczem do odnalezienia zapomnianej krainy.', 9, 2);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Tajemnice Podziemnego Miasta', 'W krainie, gdzie dźwięki mają magiczną moc, młody muzyk staje się ostatnią nadzieją na ocalenie zagrożonego królestwa.', 13, 5);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Cienie Zapomnianych Światów', 'Zegar zaczyna odliczać czas do klęski, a jedyną nadzieją jest podróż w czasie, aby naprawić błędy przeszłości.', 8, 2);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Zamknięta w Brzuchu Wieloryba', 'Księga przepowiedni przewiduje nadejście niezniszczalnego złego, a jedyną obroną są trzy niezwykłe klucze ukryte w odległych zakątkach świata.', 8, 1);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Niewidzialny Ogień', 'W świecie, gdzie księżycowe kamienie posiadają magiczną moc, grupa poszukiwaczy musi zdobyć je, by ocalić zagrożoną krainę.', 4, 2);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Bezsenność Snów', 'Kobieta odkrywa, że posiada zdolność przenoszenia się między wymiarami, co prowadzi ją do konfrontacji z mrocznymi siłami.', 10, 2);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Masakra Aniołów', 'W krainie baśni i legend, dzieci odkrywają magiczną bramę, która prowadzi do alternatywnego świata pełnego niezwykłych istot.', 2, 5);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Bezimienne Dusze', 'Głosy z przeszłości nawiedzają młodego naukowca, prowadząc go do odkrycia zapomnianych tajemnic i zagubionych miłości.', 9, 4);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Tandem', 'W świecie, gdzie każdy sen jest realny, bohater musi zmierzyć się z własnymi koszmarami, by ocalić swoje marzenia.', 3, 5);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('PKP 2033', 'Tajemniczy pierścień daje bohaterowi moc manipulowania czasem, ale jednocześnie niesie ze sobą niebezpieczne konsekwencje.', 14, 1);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Janek Zbydgoszczy i Zakazana Polana', 'Na pustyni ożywającej wyobraźni, młoda artystka odkrywa magiczny pędzel, który przynosi do życia jej najskrytsze marzenia.', 7, 1);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Janek Zbydgoszczy i Butelka Przebudzenia', 'W świecie, gdzie wszystko jest możliwe, grupa podróżników musi odnaleźć drzwi do domu, zanim zostaną uwięzieni na zawsze.', 9, 2);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Janek Zbydgoszczy i Diabelska Przejażdżka', 'Dziedzictwo magicznego klucza prowadzi rodzeństwo przez labirynt zakazanych krain, gdzie czas zaczyna się zataczać.', 5, 5);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Trzy kruki i gołąb', 'W krainie snów, gdzie marzenia stają się rzeczywistością, bohater musi stawić czoła swoim największym obawom.', 4, 5);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Dla każdego chleba starczy', 'Młoda dziewczyna odkrywa, że ma zdolność rozmawiania z duchami, co prowadzi ją do rozwiązania tajemnicy z przeszłości.', 8, 2);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Koce i rozmowy', 'W mieście, gdzie iluzje stają się rzeczywistością, detektyw próbuje odkryć prawdę ukrytą za zasłoną magicznego zaklęcia.', 5, 4);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Żówł i inne ciężkie słowa', 'Grupa przyjaciół odkrywa, że ich dziecięce zabawy w domu na drzewie mają wpływ na rzeczywistość, zmieniając bieg ich własnych losów.', 8, 5);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Oczy ważki', 'Mroczna księga, której treść przewiduje koniec świata, staje się celem obieżyświatowego poszukiwacza wiedzy.', 14, 3);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Witamina T', 'Podczas nocnej burzy, grupa ludzi odkrywa tajemniczy portal do innej epoki, gdzie muszą wypełnić pradawną przepowiednię.', 13, 5);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Jak gotować, żeby nie trafić na SOR', 'W futurystycznym społeczeństwie, gdzie emocje są zakazane, bohaterowie próbują przywrócić ludziom zdolność do odczuwania.', 5, 4);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Planeta 0', 'Tajemnicza karta tarota zaczyna wpływać na życie młodej wróżki, odsłaniając zapomniane przeznaczenie.', 3, 5);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Wysokoprofilowiec', 'W świecie, gdzie każdy uśmiech posiada magiczną moc, grupa bohaterów musi pokonać mroczne siły, aby przywrócić radość.', 12, 4);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Lot', 'Książka z zakazanymi zaklęciami staje się przyczyną chaosu, gdy przypadkowy czytelnik zaczyna odkrywać potężne moce.', 6, 2);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Zjadłem wszystkie pierniczki z choinki', 'W labiryncie snów i koszmarów, bohater musi znaleźć wyjście, zanim utknie na zawsze w zakamarkach własnej psychiki.', 8, 2);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Co jest takiego w motylu', 'Gdy gwiazdy zaczynają gasnąć, grupa astronautów musi odkryć przyczynę i uratować wszechświat przed zapomnieniem.', 4, 4);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Drewno w kuchni', 'Złote pióro wprowadza bohatera w magiczny świat, gdzie każde napisane słowo nabiera życia.', 12, 5);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Białe ściany w wariatkowie', 'W mieście, gdzie rzeczywistość jest kształtowana przez marzenia, bohater musi odkryć, że czasem koszmary prowadzą do największych cudów.', 8, 1);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Dużo widziałem, mało słyszałem', 'Skrzynia ze złotymi kluczami staje się bramą do krainy, gdzie każde drzewo ma opowieść do opowiedzenia.', 5, 3);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Wielkie wróżki i małe smoki', 'Młoda alchemiczka odkrywa, że jej magiczne eliksiry mają zdolność otwierania portali do innych wymiarów.', 7, 1);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Różowe słońce', 'Kobieta budzi się w świecie, gdzie każde lustro prowadzi do innej rzeczywistości, odkrywając prawdę o sobie.', 8, 1);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Ja, płetwa', 'W krainie, gdzie kolorowe kredki posiadają moc tworzenia rzeczywistości, dzieci stają się twórcami swojego własnego świata.', 7, 4);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Lukier', 'Niewinna zabawa w ukrywanego prowadzi grupę dzieci do magicznego lasu, gdzie muszą pokonać stworzenia z ich największych strachów.', 14, 3);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Grać, czy nie grać? Oto jest pytanie', 'Księga wspomnień, której treść jest zamazana, jest kluczem do odkrycia zapomnianych tajemnic i skarbów.', 4, 2);
INSERT INTO ksiazka (tytul, opis, autor_id, wydawnictwo_id) VALUES ('Fikcja nie bajka', 'W starożytnym grobowcu, grupa archeologów odkrywa tajemnicze malowidło, które przewiduje nadejście nadnaturalnej siły.', 1, 2);
